import {Fragment} from 'react'
import ReactDOM from 'react-dom';

const product = 'Macbook';
const model = ' Air'
const item = product + model;
const imageUrl = "testurl";

ReactDOM.render(
  <>
    <h1>나만의 {item}  주문하기</h1>
    <img src={imageUrl} alt="test" />
  </>,
  document.getElementById('root')
);
